<style type="text/css">.zaz--standalone .cmp-switch-btn {
	width: 50px;
	height: 25px;
	background: #33332f;
	cursor: pointer;
	margin: 0 5px;
	position: relative;
	border-radius: 15px;
	float: left;
	box-shadow: 2px 2px 2px #a5a598;
}

.zaz--standalone .cmp-switch-btn .layer-btn {
	width: 25px;
	height: 25px;
	left: 0;
	background: #fff;
	border-radius: 15px;
	box-shadow: 0 0 1px #777;
	position: relative;
	z-index: 3;
	-ms-transition: all 100ms linear;
	-webkit-transition: all 100ms linear;
	-moz-transition: all 100ms linear;
	transition: all 100ms linear;
}

.zaz--standalone .cmp-switch-btn .background-layers {
	width: 100%;
	height: 100%;
	overflow: hidden;
	position: absolute;
	border-radius: 15px;
}

.zaz--standalone .cmp-switch-btn .layer-on {
	position: absolute;
	width: 100%;
	height: 100%;
	left: 0;
	top: 0;
	border-radius: 15px;
	background: #98d62d;
	z-index: 2;
	-ms-transition: all 100ms linear;
	-webkit-transition: all 100ms linear;
	-moz-transition: all 100ms linear;
	transition: all 100ms linear;
}

.zaz--standalone .cmp-switch-btn.is-on .layer-btn {
	left: 25px;
}

.zaz--standalone .cmp-switch-btn.is-on .layer-on {
	left: 0;
}

.zaz--standalone .cmp-switch-btn.is-off .layer-on {
	left: -50px;
}

.zaz--standalone .cmp-switch-btn.is-disabled {
	background: #f1f1f1;
	cursor: default;
}

.zaz--standalone .cmp-switch-btn.is-disabled .layer-btn {
	background: #d7d7d7;
}

.zaz--standalone .cmp-switch-btn.is-disabled .layer-on {
	left: 0;
	background: #f1f1f1;
}

.zaz--standalone .cmp-switch-btn-sm {
	width: 30px;
	height: 15px;
}

.zaz--standalone .cmp-switch-btn-sm .layer-btn {
	width: 15px;
	height: 15px;
}

.zaz--standalone .cmp-switch-btn-sm.is-on .layer-btn {
	left: 15px;
}

