<style type="text/css">html[data-range="small"] .zaz--standalone .nb-search {
	padding-top: 5px;
}

.zaz--standalone .searchField {
	display: inline-block;
	margin: 5px;
	background: #fff;
	position: relative;
	z-index: 3;
	padding: 2px 5px 0 10px;
	height: 30px;
	-ms-transition: all 200ms linear;
	-webkit-transition: all 200ms linear;
	-moz-transition: all 200ms linear;
	transition: all 200ms linear;
}

html[data-range='xsmall'] .zaz--standalone .searchField,
html[data-range='small'] .zaz--standalone .searchField {
	margin-top: 0;
}

.zaz--standalone .searchField[data-format=icon] {
	border-color: transparent;
	background: transparent;
}

.zaz--standalone .searchField[data-format=icon] input {
	width: 0;
	opacity: 0;
}

.zaz--standalone .searchField[data-format=compact] input {
	width: 80px;
}

.zaz--standalone .searchField[data-format=full] {
	visibility: visible;
}

.zaz--standalone .searchField input {
	border: 0;
	outline: none;
	height: 24px;
	width: 200px;
	display: inline;
	font-size: 14px;
	font-style: italic;
	background-color: #FFFFFF;
	-ms-transition: all 200ms linear;
	-webkit-transition: all 200ms linear;
	-moz-transition: all 200ms linear;
	transition: all 200ms linear;
}

.zaz--standalone .searchField input:focus {
	color: #33332f;
	font-style: normal;
	outline: none;
}

.zaz--standalone .searchField input::-ms-clear {
	display: none;
}

.zaz--standalone .searchField__icon {
	top: 4px;
	cursor: pointer;
	position: relative;
}

.zaz--standalone .za-search-component {
	position: relative;
	display: inline-block;
	z-index: 99995;
}

.zaz--standalone .za-search-component .za-search__resultList {
	position: absolute;
	left: 5px;
	top: 60px;
	z-index: 1;
}

.zaz--standalone .za-search-component[data-show-autocomplete=true] {
	z-index: 99999;
}

.zaz--standalone .za-search__resultList {
	position: relative;
}

.zaz--standalone .za-search__resultList:before {
	content: '';
	position: absolute;
	left: 40px;
	top: -10px;
	width: 0;
	height: 0;
	border-top: solid 5px transparent;
	border-right: solid 5px transparent;
	border-left: solid 5px transparent;
	border-bottom: solid 5px #fff;
	margin-left: -5px;
}

.zaz--standalone .za-search__resultList {
	border-radius: 5px;
	width: 235px;
	display: block !important;
	min-height: 40px;
	min-width: 235px;
	background-color: #fff;
	margin-top: -20px;
	padding: 5px;
	border-radius: 5px;
	z-index: 999999;
	box-shadow: 0 1px 5px rgba(0, 0, 0, 0.8);
	font-size: 12px;
}

.zaz--standalone .za-search__resultList li {
	font-family: OpenSans, sans-serif;
	display: block;
}

.zaz--standalone .za-search__resultList a {
	color: #33332f;
	text-decoration: none;
	display: block;
	padding: 10px;
}

.zaz--standalone .za-search__resultList a:hover,
.zaz--standalone .za-search__resultList a:active,
.zaz--standalone .za-search__resultList a:focus {
	outline: none;
	background: #f1f1f1;
}

.zaz--standalone .za-search__resultList a img {
	float: right;
	margin-top: -5px;
	max-width: 80px;
}

.zaz--standalone .za-search__resultList .search-title-label {
	text-align: right;
	font-size: 10px;
	border-top: solid 1px #f1f1f1;
	padding-top: 10px;
}

.zaz--standalone .za-search__resultList img {
	float: right;
	margin-top: -5px;
	max-width: 80px;
	margin-right: -8px;
}

.zaz--standalone .za-search__resultList.zaz__loader {
	padding-top: 60px;
	background-color: #fff;
	background-position: center center;
}

.zaz--standalone .za-search-locker {
	position: fixed;
	left: 0;
	top: 0;
	width: 100%;
	height: 100%;
	background-color: transparent;
	display: none;
}

.zaz--standalone .za-search-locker.is__visible {
	display: block;
}

.zaz--standalone .onDarkBackground .searchField {
	border: solid 1px transparent;
}

#za-search-auto-nb-search {
	display: none;
}

